My First Sex Teacher - Jezebel Jones 

Actors: Jezebel Jones , Seth Gamble

Release Date: October 20, 2010

Seth is trying to finish up his fantasy football draft before his study session with Prof Jones. She puts a stop to that and ruins his draft! It seems she only cares about the subject matter and not football. But if he wants a fantasy, Jezebel has one for him....fucking her right there in her classroom.

